import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {
  const [count, setCount] = useState(0);

  function handlePlus(){
    setCount(count + 2);
  }
  return (
    <div className="App">
      <h1>The count is: {count}</h1>
     <button onClick={handlePlus}>+</button>
    </div>

  );
}

export default App;
